const methods = {
  test: (a) => {
    alert(a)
    // a = !a
    if(this.a === false){
      alert('ss')
      this.a = true
    } else{
      this.a = false
    }
    return true
  }
}



export default {
  install(Vue) {
    Vue.prototype.$test = methods.test
  }
}
